import React from "react";
import VideoGrid from "./VideoGrid"; // Video grid for participants
import Controls from "./Controls"; // Controls for video/audio mute, leave button

function MeetingRoom() {
  return (
    <div className="meeting-room">
      {/* Header Section */}
      <header className="header">
        <h1>Meeting Room</h1>
        <button className="leave-btn">Leave Call</button>
      </header>

      {/* Video Grid Section */}
      <div className="video-grid-container">
        <VideoGrid />
        
        {/* Local Video */}
        <div className="local-video-container">
          <video
            className="local-video"
            autoPlay
            muted
            playsInline
          />
        </div>
      </div>

      {/* Controls Section */}
      <Controls />
    </div>
  );
}

export default MeetingRoom;
